const NoteLength = ({item, column, noteLength}) => {

    const changeNoteLength = () => {
        alert(column)
        noteLength[column] = 500
    }

    return (
        <p className='mr-3'  onClick={() => changeNoteLength()}>{item.name}</p>
    )
}

export default NoteLength
